16:"vod_pwd_play_url";s:0:"";s:12:"vod_pwd_down";s:0:"";s:16:"vod_pwd_down_url";s:0:"";s:11:"vod_content";s:1777:"科幻片《回到未来》那款可以穿越时空的跑车现实生活中曾批量生产过，但公司还没撑到电影上映就破产了公司的创始人叫约翰·德罗宁，这个英国人曾被誉为史上最大胆的汽车商人，也可能是史上最大的汽车骗子。近日一部描述他的纪录片《创造约翰德罗宁》发布首款预告（时光网独家听译中字），《碟中谍6》男星，也就是经常在电视节目中模仿川普的亚历克·鲍德温扮演德罗宁本尊，《死侍》女星莫瑞娜·巴卡琳扮演德罗宁的超模妻子。《创造约翰德罗宁》不是一部单纯的纪录片，里面既有原型约翰·德罗宁、子女、同事等人的访谈、新闻资料，也有扮演他的亚历克·鲍德温的“场景重现”画面，甚至有亚历克·鲍德温在片场间隙的采访。算是纪录片+剧情片奇妙混合，将于今年6月7日在美国部分影院上映。德罗宁是一家已经消失的美国汽车制造厂，由汽车业高级主管，英国人约翰·德罗宁于1975年创立。它以生产与众不同具有鸥翼车门和不锈钢车体的德罗宁DMC-12汽车闻名于世。德罗宁跑车成名于在世界各地广受欢迎的《回到未来》电影，影片1985年上映，但德罗宁公司1982年就破产了。电影中德罗宁DMC-12跑车被古怪的科学家埃米特·L·布朗博士改装成时间旅行机器，其形象成为普遍的大众回忆。由于公司破产，不再有新车出厂，DMC-12反而成为珍藏品。但直到今日，大量的DMC-12依然还在使用当中。一般估计，生产约9000辆的DMC-12中有6500辆仍在使用，许多由车主、爱好者形成的社团与俱乐部依然十分活跃，甚至成为一种特殊的文化。";s:13:"vod_play_from";s:38:"dbm3u8$$$gqm3u8$$$zuidam3u8$$$subom3u8";s:15:"vod_play_server";s:17:"no$$$no$$$no$$$no";s:13:"vod_play_note";s:9:"$$$$$$$$$";s:12:"vod_play_url";s:280:"HD720P$https://dbx5.tyswmp.com/20190713/uypwSb2x/index.m3u8$$$HD720P$https://gqnew1.jongta.com/20190713/L0IGi0Np/index.m3u8$$$HD1280高清中英双字版$http://wuji.zhulong-zuida.com/20190714/1821_218ab447/index.m3u8$$$HD高清$https://www.qzamfz.com/20190714/CZqQJOYI/index.m3u8";s:13:"vod_down_from";s:0:"";s:15:"vod_down_server";s:0:"";s:13:"vod_down_note";s:0:"";s:12:"vod_down_url";s:0:"";s:4:"type";a:18:{s:7:"type_id";i:22;s:9:"type_name";s:9:"其他片";s:7:"type_en";s:8:"qitapian";s:9:"type_sort";i:8;s:8:"type_mid";i:1;s:8:"type_pid";i:1;s:11:"type_status";i:1;s:8:"type_tpl";s:9:"type.html";s:13:"type_tpl_list";s:9:"show.html";s:15:"type_tpl_detail";s:11:"detail.html";s:13:"type_tpl_play";s:9:"play.html";s:13:"type_tpl_down";s:9:"down.html";s:8:"type_key";s:0:"";s:8:"type_des";s:0:"";s:10:"type_title";s:0:"";s:10:"type_union";s:0:"";s:11:"type_extend";a:8:{s:5:"class";s:0:"";s:4:"area";s:0:"";s:4:"lang";s:0:"";s:4:"year";s:0:"";s:4:"star";s:0:"";s:8:"director";s:0:"";s:5:"state";s:0:"";s:7:"version";s:0:"";}s:6:"type_1";a:18:{s:7:"type_id";i:1;s:9:"type_name";s:6:"电影";s:7:"t